import React from "react";
import Profile from "../pages/profile";
import Proptypes from "prop-types";
import Link from "next/link";

const AppLayout = ({ children }) => {
  return (
    <div>
      <Link href="/">
        <a>노드버드</a>
      </Link>
      <Link href="/profile">
        <a>프로필</a>
      </Link>
      <Link href="/signup">
        <a>회원가입</a>
      </Link>

      {children}
    </div>
  );
};

AppLayout.prototype = {
  children: Proptypes.node.isRequired,
};

export default AppLayout;
